import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div style={{alignContent:'center'}}>
      <form>
        <label>
          CUI:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}

export default App;
